  }


  return (
    <>
      <div>
         <div>
            <h1>{num}</h1>
            <div>
              <button onClick={incrementNum}>Increment</button>
              <button>Decrement</button>
            </div>
         </div>
      </div>
    </>

  );
}

export default App;
